import React from "react";
import Sdata from "./Sdata";
import Netflixcard from "./Netflixcard";
 function ncard(val)
    {
        return(          
 <Netflixcard
        imgsrc={val.imgsrc}
        title={val.title}
        sname={val.sname}
        link={val.link}
    /> )
    }
function Cards()
{
   
    return (
 <>
{Sdata.map(ncard)}
{Sdata.map(ncard)}

 </>  
    )
}
export default Cards;
